/* Styling Checkbox Starts */
.checkbox-label {
color: #88FFF7;
    display: block;
    position: relative;
    margin: auto;
    cursor: pointer;
    font-size: 22px;
    line-height: 24px;
    height: 50px;
    width: 24px;
    clear: both;
}
.checkbox-label input {
    position: absolute;
    opacity: 0;
    cursor: pointer;
}

.checkbox-label .mark {
	top:30px;
    position: absolute;
    height: 24px;
    width: 24px;
    background-color: #4FBDBA;
    border-radius: 5px;
    transition: all 0.3s ease-in;
    border: 2px solid black;
}
.checkbox-label input:checked ~ .mark {
    background-color: #96BAFF;
    border-radius: 5px;
    transform: rotate(0deg) scale(1);
    opacity:1;
    border: 2px solid #7C83FD;
}
.checkbox-label .mark::after {
    position: absolute;
    content: "";
    border-radius: 5px;
}
.checkbox-label input:checked ~ .mark::after {
  transform: rotate(45deg) scale(1);
  left: 8px;
  top: 3px;
  width: 6px;
  height: 12px;
  border: solid #7DEDFF;
  border-width: 0 2px 2px 0;
  border-radius: 0;
}
/* For Ripple Effect */ 
.checkbox-label .mark::before {
    position: absolute;
    content: "";
    border-radius: 10px;
    border: 5px solid yellow;
    transform: scale(0);    
}

.checkbox-label input:checked ~ .mark::before {
    left: -3px;
    top: -3px;
    width: 24px;
    height: 24px;
    border-radius: 5px;
    transform: scale(3);
    opacity:0;   
    transition: all 0.3s ease-out;
}
